    let n = parseInt(arguments[1].clone());
    let mut adj: Vec<i64> = Vec::with_capacity(n as usize);
    let mut adjStarts: Vec<i64> = Vec::with_capacity(n as usize);
    let mut adjCounts: Vec<i64> = Vec::with_capacity(n as usize);
    for i in 0..n {
        adjStarts.push((i * 5));
        adjCounts.push(0);
        adj.push(0);
        adj.push(0);
        adj.push(0);
        adj.push(0);
        adj.push(0);
    }
    let mut i = (0_i64).max(n);
    let mut primes = Seq::<i64>::default();
    primes.push(31);
    primes.push(37);
    primes.push(41);
    primes.push(43);
    primes.push(47);
    let mut offsets = Seq::<i64>::default();
    offsets.push(7);
    offsets.push(13);
    offsets.push(17);
    offsets.push(23);
    offsets.push(29);
    for p in 0..5 {
        unsafe { std::hint::assert_unchecked((n as usize) <= adjStarts.len()); }
        unsafe { std::hint::assert_unchecked((n as usize) <= adjCounts.len()); }
        for i in 0..n {
            let neighbor = (((i * primes[p as usize]) + offsets[p as usize]) % n);
            if (neighbor != i) {
                let start = adjStarts[i as usize];
                let cnt = adjCounts[i as usize];
                adj[((start + cnt)) as usize] = neighbor;
                adjCounts[(i) as usize] = (cnt + 1);
            }
        }
    }
    let mut queue = Seq::<i64>::default();
    let mut dist: Vec<i64> = Vec::with_capacity(n as usize);
    for i in 0..n {
        dist.push((0 - 1));
    }
    i = (0_i64).max(n);
    queue.push(0);
    dist[0] = 0;
    let mut front = 1;
    unsafe { std::hint::assert_unchecked(((queue.len() as i64) as usize) <= queue.len()); }
    while (front <= (queue.len() as i64)) {
        let v = queue[(front - 1) as usize];
        let start = adjStarts[v as usize];
        let cnt = adjCounts[v as usize];
        unsafe { std::hint::assert_unchecked((cnt as usize) <= adj.len()); }
        for e in 0..cnt {
            let u = adj[((start + e)) as usize];
            if (dist[u as usize] == (0 - 1)) {
                dist[(u) as usize] = (dist[v as usize] + 1);
                queue.push(u);
            }
        }
        front = (front + 1);
    }
    let mut reachable = 0;
    let mut totalDist = 0;
    unsafe { std::hint::assert_unchecked((n as usize) <= dist.len()); }
    for i in 0..n {
        if (dist[i as usize] >= 0) {
            reachable = (reachable + 1);
            totalDist = (totalDist + dist[i as usize]);
        }
    }
    show(&format!("{}{}{}{}", "", reachable, " ", totalDist));
}

